package aop.service.impl;import aop.domain.RequestLogs;import aop.mapper.RequestLogsMapper;import aop.service.IRequestLogsService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;@Servicepublic class RequestLogsServiceImpl implements IRequestLogsService {    @Autowired    private RequestLogsMapper requestLogsMapper;    public int insertRequestLogs(RequestLogs requestLogs){        return requestLogsMapper.insertRequestLogs(requestLogs);    }}